<script>
var time = 240000; // 30 minutes
var pause = false;
var speed = 1;

function harold(standIn) {
  if (standIn < 10) {
    standIn = '0' + standIn
  }
  return standIn;
}

function clock() {// We create a new Date object and assign it to a variable called "time".
  if (pause || time <= 0) return;
  var rounded = Math.floor(time);
  var minutes = Math.floor(rounded / 100 / 60);
  var seconds = Math.floor((rounded - (minutes * 100 * 60)) / 100)
  var millis = rounded - (minutes * 100 * 60) - (seconds * 100)
  document.querySelectorAll('.clock')[0].innerHTML = harold(minutes) + ":" + harold(seconds) + ":" + harold(millis);
  if (time < 30000 && time != 0) {
    time -= (time / 30000) * 0.5 + 0.001;
  } else {
    time -= 1;
  }
}
setInterval(clock, 10);
</script>
